import React, { Component } from 'react';
import { Link } from "react-router-dom";

class Home extends Component {
    render() {
        return (
            <div
                className="col-md-6 d-flex flex-column justify-content-center align-items-center"
                style={{
                    padding: "70px",
                    paddingLeft: "200px",
                    paddingRight: "200px",
                }}
            >
                <h1 className="homeTitle">
                    Blanc-Manger COCO
                </h1>
                <p className="homeDescription">
                    Lorem, ipsum dolor sit amet consectetur adipisicing elit. Minus adipisci beatae itaque libero provident tempora et vel quibusdam ipsam maiores.
                </p>
                <div className="d-flex w-100 justify-content-between">
                    <Link className="homeBtn" to="/signup">Inscription</Link>
                    <Link className="homeBtn" to="/signin">Connexion</Link>
                </div>
            </div>
        );
    }
}

export default Home;
